pragma solidity ^0.4.24;

import "./SafeMathLib.sol";
import "./BankService.sol";
import "./BankAccount.sol";
import "./Bank.sol";
import "./Banks.sol";

contract BSFaucet is BankService {
    using SafeMath for uint256;

    string constant TYPE_CODE = "FAUCET";

    event ServiceTransaction(uint256 transactionId, uint256 timestamp, uint256 indexed toPAN, uint256 toValue);

    struct Transaction {
        bool inUsed;
        uint256 timestamp;
        uint256 toPAN;
        uint256 toValue;
        string metadata;
    }

    // Transactions (mapped: holder address + transaction id => Transaction)
    mapping(address => mapping(uint256 => Transaction)) public transactions;

    Banks banks;

    constructor(address _banksAddress, string _label, string _description) public
        BankService(address(0), TYPE_CODE, _label, _description)
    {
        require(address(0) != _banksAddress, "Banks address is empty");
        banks = Banks(_banksAddress);
    }

    function record(uint256 _toPAN, uint256 _toValue, string _metadata) public
        isUsable
        returns(uint256 transactionId, address to)
    {
        (, BankAccount toa, address toAddress) = banks.getBankAccount(_toPAN);
        require(address(toa) == msg.sender, "Access denied");

        to = toAddress;
        transactionId = banks.transactionsCount(toAddress);

        transactions[toAddress][transactionId] = Transaction({
            inUsed: true,
            timestamp: now,
            toPAN: _toPAN,
            toValue: _toValue,
            metadata: _metadata
        });

        emit ServiceTransaction(transactionId, now, _toPAN, _toValue);
    }

    function sealRequirement() private view
    {
    }

}
